INSERT INTO `t_visi_misi` (`id`, `visi`, `misi`, `created_at`, `updated_at`) VALUES
(3, 'Terwujudnya desa yang agamis, sejahtera, maju dan merata, masyarakat yang berbudaya, berdaya saing dan bermartabat dengan pelayanan public yang transparan, akuntabel.', '1. Mewujudkan pemerintahan desa yang professional, amanah, ramah, jujur dan berwibawa dengan pengambilan keputusan yang cepat dan tepat berdasarkan musyawarah.\r\n2. Mengedepankan kejujuran dan musyawarah mufakat dalam kehidupan sehari-hari baik dengan pemerintah maupun dengan masyarakat Desa Payungagung.\r\n3. Meningkatkan profesionalitas dan mengaktifkan seluruh perangkat desa, serta mengoptimalkan fungsi lembaga desa.\r\n4. Mewujudkan sarana dan prasarana Desa Payungagung yang memadai.\r\n5. Mewujudkan perekonomian dan kesejahteraan warga desa.\r\n6. Meningkatkan pelayanan kesehatan masyarakat desa yang maksimal.\r\n7. Meningkatkan kehidupan desa secara dinamis dalam segi keagamaan dan kebudayaan.', NULL, '2024-08-26 11:12:11');
